import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

}
<p>home works!</p>
<div style="margin: 2em;">
    <button routerLink="/auth/signup" style="margin: 1em;">Sign up</button>
    <button routerLink="/auth/signin" style="margin: 1em;">Sign in</button>
</div>
